import React from 'react'
import { FaPlusCircle } from "react-icons/fa";
import Greenbtn from './Greenbtn';


const PricingCard = ({prices,dolar,features}) => {

    
         
  return (
    <div className='bg-white text-slate-900 m-4 rounded-xl overflow-hidden shadow-2xl'>
              <div className='text-center bg-darkcolor text-white py-4 uppercase'>
                <p>{prices}</p>
              </div>
              <div className='p-4'>
                <p className='text-6xl font-bold py-4 flex'>{`$${dolar}`}
                <span className='text-xl text-darkcolor flex flex-col justify-end'>/mo</span></p>
              </div>
              <p className='text-2xl px-4 py-8 text-slate-500'>
                Et clita rebum ea elitr no elitr est et, invidunt et sea consetetur 
                clita et lorem lorem. Clita nonumy tempor.
              </p>
              <div className='text-2xl'>
                  <div className='px-4'>
                    {features.map(({id,title})=>(
                      <p key={id} className='flex items-center py-3 text-lg'>
                      <FaPlusCircle className='w-5 mr-3 text-lightcolor'/>
                       {title}
                      </p>
                    ))}
                  
                  </div>
            
                <Greenbtn title='Get Started' className='w-full py-4 mt-14 rounded-none
                 hover:bg-darkcolor hover:border-none'/>
              </div>
              </div>
  )
}

export default PricingCard
